import React from 'react';
import BannerProcess from '../components/Banner/BannerProcess';
import ScrumTeam from '../components/Process/ScrumTeam';
import ScrumEvents from '../components/Process/ScrumEvents';
import Designtab from '../components/Process/Designtab';



const Scrum = () => {
    return(
        <div className="body_wrapper">
 
            <BannerProcess 
                Pclass="scrum_banner_area"
                P2class="shape one"
                Title="TitleScrum" 
                TextD="TextDScrum"
                img_process="img_scrum.png"/>            
            <ScrumEvents
            
            />
            <ScrumTeam/>
            <Designtab/>
        </div>
    )
}
export default Scrum;
